class Solution(object):
    def nextGreatestLetter(self, letters, target):
        """
        :type letters: List[str]
        :type target: str
        :rtype: str
        """

        if target < letters[0] or target >= letters[-1]:
            return letters[0]

        left = 0
        right = len(letters) - 2

        while left <= right:

            mid = (left + right) // 2

            if target >= letters[mid]:
                res = letters[mid+1]
                left = mid + 1
            else:
                res = letters[mid]
                right = mid - 1


        return res
